void HAL_TIM_PeriodElapsedCallback(TIM_HandleTypeDef *htim) {	//ODometry
	//HAL_GPIO_TogglePin(LED_GPIO_Port, LED_Pin);

	float velocity[3] = {0};	//rolicon_velocity

	//rotation value
	velocity[0] = read_encoder_value2();	//rolicon1
	velocity[1] = read_encoder_value3();	//rolicon2
	velocity[2] = read_encoder_value1();	//rolicon3

	for(int i = 0; i < 3; i++)
		count[i] += velocity[i];

	//linear velocity
	for(int i = 0; i < 3; i++) {
		velocity[i] *= (WHEEL / ROUND);	// linear distance [m]
		velocity[i] /= CONTROL_CYCLE;	// linear velocity [m/s]
	}

	//3-wheel OMni inverse matrix
	float vx = (-2 * velocity[0] + velocity[1] + velocity[2]) / 3;
	float vy =                    (velocity[1] - velocity[2]) / sqrt(3);
	float va =      (velocity[0] + velocity[1] + velocity[2]) / (3 * ROBOT_RADIUS);

	//Minute distance
	float dx = vx * CONTROL_CYCLE;	//Minute x_distance
	float dy = vy * CONTROL_CYCLE;	//Minute y_distance
	float da = va * CONTROL_CYCLE;	//Minute a_angle

	//Integrated value
	vector_theta -= da; //1 Circumference = 6.3 (=2pi?)									//Absolute a_angle
	//Rotation matrix
	vector_x     -= ((double)dx * cos(vector_theta) - (double)dy * sin(vector_theta));	//Absolute x_distance
	vector_y     -= ((double)dx * sin(vector_theta) + (double)dy * cos(vector_theta)); 	//Absolute y_distance
}

//omni3:   target_coordinate_angle[rAd], power[-], target_robot_angle[rAd]
void omni3(double target_c_angle, double power, double target_r_angle) {	//Omni_motors_power
	double duty_theta = 0;

	power = fabs(power);
	if(power > MAX)
		power = MAX;    //power=0~127

    //current_r_angle = deg_to_rad(current_r_angle);
    //target_c_angle  = deg_to_rad(target_c_angle);

	pid_control_theta((double)target_r_angle, (double)vector_theta, &duty_theta, 0); //PID value

    float power_x     = (float)power * cos(target_c_angle);		//x
    float power_y     = (float)power * sin(target_c_angle); 	//y
    float power_theta =   duty_theta * ROBOT_RADIUS;            //tHeta

    power_x = power_x * cos(vector_theta) - power_y * sin(vector_theta);	//x, Rotation matrix
    power_y = power_x * sin(vector_theta) + power_y * cos(vector_theta);	//y, Rotation matrix

    tire[0] = (double)(   power_x                                           + (ROBOT_RADIUS * power_theta));
    tire[1] = (double)(((-power_x / 2.0f + (sqrt(3.0f) *  power_y)) / 2.0f) + (ROBOT_RADIUS * power_theta));
    tire[2] = (double)(((-power_x / 2.0f - (sqrt(3.0f) *  power_y)) / 2.0f) + (ROBOT_RADIUS * power_theta));

    //////Maximum value adjustment//////
	double max = fabs(tire[0]);
	for(int i = 1; i < 3; i++)
		if(fabs(tire[i]) > max)
			max = fabs(tire[i]);

	if(max > MAX)
		for(int i = 0; i < 3; i++)
			tire[i] = (tire[i] / max) * MAX;
}

